INSERT INTO `film` VALUES ('8', '抢红 (2017)', '5.7', '136分钟 / 动作 / 科幻 / 冒险 / 詹姆斯·古恩(导演) / 克里斯·普拉特 / 佐伊·索尔达娜 / 戴夫·巴蒂斯塔 / 范·迪塞尔 / 布莱德利·库珀 / 凯伦·吉兰 / 迈克尔·鲁克 / 庞·克莱门捷夫 / 伊丽莎白·德比茨基 / 肖恩·古恩 / 库尔特·拉塞尔 / 克里斯·沙利文 / 大卫·哈塞尔霍夫 / 西尔维斯特·史泰龙 / 杨紫琼 / 2017-05-05(中国大陆) 上映', '<p style=\"text-align: center; \"><img src=\"data:image/webp;base64,\" style=\"width: 300px;\" data-filename=\"qh.webp\"></p><blockquote style=\"text-align: center; \">导演: 黎明<br>主演: 张涵予 / 黎明 / 王耀庆 / 杜鹃 / 南伏龙 / 更多...<br>类型: 动作 / 犯罪<br>制片国家/地区: 中国大陆<br>语言: 汉语普通话<br>上映日期: 2017-05-19(中国大陆)<br>片长: 90分钟<br>又名: Z计划 / Wine War<br>IMDb链接: tt3699104</blockquote><p style=\"text-align: center; \"><br></p><div class=\"related-info\" style=\"margin: 0px 0px -10px; padding: 0px;\"><h2 style=\"text-align: center; margin: 24px 0px 3px; padding: 0px; font-stretch: normal; line-height: 22.5px;\"><font color=\"#ff0000\"><span class=\"\">抢红的剧情简介</span>&nbsp;</font></h2><div class=\"indent\" id=\"link-report\" style=\"color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif; font-size: 12px; margin: 0px 0px 30px; padding: 0px; word-break: break-all;\"><span property=\"v:summary\" class=\"\">　　朝不保夕的司机张水（张涵予 饰），受上司方长方（王耀庆 饰）利诱，答应亲赴法国邀请义弟韦力（黎明 饰）帮忙参加天价红酒的竞拍。张水谎称为国家执行秘密任务骗得韦力的信任，一同前往品酒大会。拍卖现场，张水意外的发现指使自己来参加拍卖会的老板方长方也在现场，而此时的方长方好像从没认识过张水...品酒会的主持者利芳（杜鹃 饰）与各路买家逐一品酒，只有通过考验的人才可以参与到竞拍环节。&nbsp;<br>　　利芳同父异母的哥哥LK此时在众人之外静静的看着所发生的一切，谁也想不到，拍卖会的真正目的根本不是卖酒……</span></div></div><div id=\"celebrities\" class=\"celebrities related-celebrities\" style=\"margin: 0px; padding: 0px;\"><h2 style=\"text-align: center; margin: 0px 0px 12px; padding: 0px; font-stretch: normal; line-height: 22.5px;\"><span class=\"\"><font color=\"#ff0000\">抢红的影人</font></span></h2><ul class=\"celebrities-list from-subject\" style=\"color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif; font-size: 12px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; list-style: none; overflow: hidden; display: flex; flex-flow: row wrap; justify-content: sp