INSERT INTO `film` VALUES ('9', '当怪物来敲门 A Monster Calls (2016)', '7.1', '108分钟 / 剧情 / 儿童 / 奇幻 / 胡安·安东尼奥·巴亚纳(导演) / 刘易斯·麦克杜格尔 / 西格妮·韦弗 / 菲丽希缇·琼斯 / 连姆·尼森 / 托比·凯贝尔 / 本·摩尔 / 詹姆斯·梅尔维尔 / 多米尼克·博伊尔 / 詹尼弗·林 / 摩根·赛姆斯 / 弗瑞达·帕尔森 / 婉妲·奥普琳斯卡 / 2017-05-19(中国大陆) 上映', '<p style=\"text-align: center; \"><img src=\"data:image/webp;base64,\" style=\"width: 300px;\" data-filename=\"gw.webp\"></p><blockquote style=\"text-align: center; \">导演: 胡安·安东尼奥·巴亚纳<br>编剧: 帕特里克·内斯 / 西沃恩·道德<br>主演: 刘易斯·麦克杜格尔 / 西格妮·韦弗 / 菲丽希缇·琼斯 / 连姆·尼森 / 托比·凯贝尔 / 更多...<br>类型: 剧情 / 儿童 / 奇幻<br>官方网站: www.focusfeatures.com/amonstercalls<br>制片国家/地区: 美国 / 西班牙 / 英国<br>语言: 英语<br>上映日期: 2017-05-19(中国大陆) / 2016-09-09(多伦多电影节) / 2016-10-07(西班牙) / 2017-01-06(美国)<br>片长: 108分钟<br>又名: 怪物召唤 / 恶魔呼唤 / 魔树奇缘(港) / 怪物来敲门(台) / Un monstruo viene a verme<br>IMDb链接: tt3416532</blockquote><div class=\"related-info\" style=\"margin: 0px 0px -10px; padding: 0px;\"><h2 style=\"text-align: center; margin: 24px 0px 3px; padding: 0px; font-stretch: normal; line-height: 22.5px;\"><span class=\"\"><font color=\"#ff0000\">当怪物来敲门的剧情简介</font></span><font color=\"#007722\" face=\"Arial, Helvetica, sans-serif\"><span style=\"font-size: 15px;\">&nbsp;</span></font></h2><div class=\"indent\" id=\"link-report\" style=\"color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif; font-size: 12px; margin: 0px 0px 30px; padding: 0px; word-break: break-all;\"><span class=\"short\"><span property=\"v:summary\">　　自从妈妈进行化疗开始，少年康纳就每天晚上都做噩梦。梦中总是漆黑阴暗的天气，狂风大作，尖叫声和无论怎么努力都不能紧握的双手让他倍受折磨。他总是做着同样内容的噩梦，直到有一天家里出现了一个不速之客，拥有古老气息的恶魔对康纳说它是由他召唤而来，它要以三个故事交换一个康纳自己真实的故事。康纳并不害怕恶魔，因为他在面对的事——最心爱的妈妈正一步步走向死亡，这是更加恐怖的事情。夜晚让康纳感觉诡异，而他白天的生活也十分难熬。康纳的爸爸离开了他们母子，前来照料他们生活的外婆又与康纳相处的不甚愉快。除此之外，他还必须忍受学校里那些惨淡的日子——老师们夸张的同情以及同学的霸凌。渐渐的，康纳发现恶魔每晚出现的时间都存在一定规律，并且它所讲的意义不明的故事似乎都隐喻着什么，它究竟是死神的使者，还是康纳所期待的出现的奇迹？而康纳一直不愿意与恶魔兑现的故事，其实是他内心深处</span></span>最黑暗的秘密。</div></div><div id=\"celebrities\" class=\"celebrities related-celebrities\" style=\"margin: 0px; padding: 0px;\"><h2 style=\"text-align: center; margin: 0px 0px