INSERT INTO `film` VALUES ('10', '美容针 (2017)', '3.8', '97分钟 / 喜剧 / 爱情 / 黄美娜(导演) / 闫妮 / 杜天皓 / 宋伊人 / 赵毅新 / 张亦驰 / 宗晓军 / 2017-05-19(中国大陆) 上映', '<p style=\"text-align: center; \"><img src=\"data:image/webp;base64,\" style=\"width: 300px;\" data-filename=\"mr.webp\"></p><blockquote style=\"text-align: center; \">导演: 黄美娜<br>编剧: 黄美娜<br>主演: 闫妮 / 杜天皓 / 宋伊人 / 赵毅新 / 张亦驰 / 更多...<br>类型: 喜剧 / 爱情<br>制片国家/地区: 中国大陆<br>语言: 汉语普通话<br>上映日期: 2017-05-19(中国大陆)<br>片长: 97分钟<br>又名: Special Encounter</blockquote><p style=\"text-align: center; \"><br></p><div class=\"related-info\" style=\"margin: 0px 0px -10px; padding: 0px; color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif; font-size: 12px;\"><h2 style=\"margin: 24px 0px 3px; padding: 0px; font-size: 15px; font-stretch: normal; font-family: Arial, Helvetica, sans-serif; color: rgb(0, 119, 34); line-height: 22.5px;\"><span class=\"\">美容针的剧情简介</span>&nbsp;</h2><div class=\"indent\" id=\"link-report\" style=\"margin: 0px 0px 30px; padding: 0px; word-break: break-all;\"><span property=\"v:summary\" class=\"\">　　熟女堂珍（闫妮 饰）还有另外一个名字—“夏百合”，曾经她用这个笔名创作了热门小说《落在胸口的星星》。同时她也以“夏百合”的身份活跃在网游世界中，并与阳光大男孩小健（杜天皓 饰）相识，小健是作家“夏百合”的仰慕者，于是好奇的提出见面，堂珍犹豫不肯之余，内心起了波澜，不过并不完美的见面令小健认为自己 被耍，内心郁闷压抑的他决定报复，几轮恶搞PK挑战过后，更多的意外出现了，小健发现堂珍真的是那个作家“夏百合”，而对于棠珍来说，小健的出现，似乎是命运给自己的一次设定，就好比“美容针”一样，唤醒了自己。一场特殊的情缘由此开始。</span></div></div><div id=\"celebrities\" class=\"celebrities related-celebrities\" style=\"margin: 0px; padding: 0px; color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif; font-size: 12px;\"><h2 style=\"margin: 0px 0px 12px; padding: 0px; font-size: 15px; font-stretch: normal; font-family: Arial, Helvetica, sans-serif; color: rgb(0, 119, 34); line-height: 22.5px;\"><span class=\"\">美容针的影人</span>&nbsp;</h2><ul class=\"celebrities-list from-subject\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; list-style: none; overflow: hidden; display: flex; flex-flow: row wrap; justify-content: space-between;\"><li class=\"celebrity\" 