INSERT INTO `film` VALUES ('11', '不期而遇 (2017)', '4.1', '94分钟 / 喜剧 / 爱情 / 陈卓(导演) / 张雨绮 / 张亮 / 王少雍 / 冷中易 / 2017-05-19(中国大陆) 上映', '<p style=\"text-align: center; \"><img src=\"data:image/webp;base64,\" style=\"width: 300px;\" data-filename=\"bqey.webp\"></p><p style=\"text-align: center; \"><br></p><blockquote style=\"text-align: center; \">导演: 陈卓<br>编剧: 右耳 / 陈卓<br>主演: 张雨绮 / 张亮 / 王少雍 / 冷中易<br>类型: 喜剧 / 爱情<br>制片国家/地区: 中国大陆 / 美国<br>语言: 汉语普通话<br>上映日期: 2017-05-19(中国大陆)<br>片长: 94分钟<br>又名: Come Across Love</blockquote><p style=\"text-align: center; \"><br></p><p style=\"text-align: center; \"><br></p><div class=\"related-info\" style=\"margin: 0px 0px -10px; padding: 0px; color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif; font-size: 12px;\"><h2 style=\"margin: 24px 0px 3px; padding: 0px; font-size: 15px; font-stretch: normal; font-family: Arial, Helvetica, sans-serif; color: rgb(0, 119, 34); line-height: 22.5px;\"><span class=\"\">不期而遇的剧情简介</span>&nbsp;</h2><div class=\"indent\" id=\"link-report\" style=\"margin: 0px 0px 30px; padding: 0px; word-break: break-all;\"><span property=\"v:summary\" class=\"\">　　捣蛋大王范小闲（张亮 饰）与正义少女李心（张雨绮 饰）从小就水火不容，一次争执后范小闲诅咒李心一辈子嫁不出去。长大成年后的范小闲虽事业有成，却遭遇婚姻、健康双重危机，李心也如他“诅咒”所说一直单身成为剩女……一对随时爆发、争执不断的冤家，怀揣各自不可告人的目的，挤进同一 辆车，行驶在美利坚美丽的公路上……</span></div></div><div id=\"celebrities\" class=\"celebrities related-celebrities\" style=\"margin: 0px; padding: 0px; color: rgb(17, 17, 17); font-family: Helvetica, Arial, sans-serif; font-size: 12px;\"><h2 style=\"margin: 0px 0px 12px; padding: 0px; font-size: 15px; font-stretch: normal; font-family: Arial, Helvetica, sans-serif; color: rgb(0, 119, 34); line-height: 22.5px;\"><span class=\"\">不期而遇的影人</span></h2><ul class=\"celebrities-list from-subject\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; list-style: none; overflow: hidden; display: flex; flex-flow: row wrap; justify-content: space-between;\"><li class=\"celebrity\" style=\"margin: 0px 10px 0px 0px; padding: 0p