-- ----------------------------
-- Table structure for `review`
-- ----------------------------
DROP TABLE IF EXISTS `review`;
CREATE TABLE `review` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `content` mediumtext,
  `f_title` varchar(200) DEFAULT NULL,
  `f_photo` mediumtext,
  `f_id` int(11) DEFAULT NULL,
  `u_id` int(11) DEFAULT NULL,
  `u_name` varchar(255) DEFAULT NULL,
  `count` int(11) DEFAULT NULL,
  `ps` varchar(200) DEFAULT NULL,
  `deleted` int(11) DEFAULT NULL,
  `score` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of review
-- ----------------------------
INSERT INTO `review` VALUES ('1', '不打分了，因为吓得半途离场了。触手系加封闭空间真的完全戳中我的怕点，还有那种缓慢而痛苦的死亡，听说后半部分更可怕，看了一半吓得跑去洗手间恶心干呕，再也不要看这种类型了。我的人生里不需要这种类型的电影。光想想我都精神衰弱了。 电影是ok的，是我自己的问题。现在躺在床上抱着狗瑟瑟发抖', '异星觉醒 Life (2017)', 'data:image/webp;base64,', '6', '3', '土豆', '2', null, '0', null);
INSERT INTO `review` VALUES ('6', '父权你mb啦，一个能发现儿女自身优点并开发出来的这个也是父母责任之一啊。反推现在的世界冠军们哪个小时候过得是自由自在吃吃喝喝的日子啊。他爸都说了你要得到这块金牌不仅是你自己的金牌更是印度好多妇女的金牌啊。摔跤真是又有力量又优美的运动，', '摔跤吧！爸爸 Dangal (2016)', 'data:image/webp;base64,\" data-filename=\"摔跤吧.webp', '4', '3', '土豆', '7', null, '0', null);
INSERT INTO `review` VALUES ('7', '最喜欢开头女儿埋怨爸爸的那段歌舞，叙事和歌舞互相成全，流畅至极。动作戏最喜欢吉塔初战男跤手和半决赛两场，人物与动作交融。为平权奋斗的主题和父女情都感人至深。民族主义煽情则显生硬。奉劝豆瓣那些不沾土不沾灰六亲不认的女权婊们，趁早移民欧美澳吧，我们发展中国家的小庙容不下你们这些大神。', '摔跤吧！爸爸 Dangal (2016)', 'data:image/webp;base64,\" data-filename=\"摔跤吧.webp', '4', '3', '土豆', '1', null, '0', null);
INSERT INTO `review` VALUES ('8', '上午场：一群人为了个红buff！各种无理取闹。下午场：一个新生命为了生存！大杀四方。逗比和科技，我选着后者！  Android', '抢红 (2017)', 'data:image/webp;base64,', '8', '3', '土豆', '0', null, '0', null);
INSERT INTO `review` VALUES ('9', '谁敢抢我红，我就刷他的野，黑他的兵线！', '抢红 (2017)', 'data:image/webp;base64,', '8', '3', '土豆', '0', null, '0', null);
INSERT INTO `review` VALUES ('10', '头一次看国产片脸盲，除了黎明张涵予完全分不清其他人。这片真是烂到无法无天目无尊长，看完我都不知道讲了个什么鬼故事，台词真特么脑残弱智。要不是因为发现四大天王里就黎明没在大银幕上见过，我也不会来遭罪了，逼死强迫症。PS：开头看到毕jj名字，感觉这辈子都值了。', '抢红 (2017)', 'data:image/webp;base64,', '8', '3', '土豆', '4', null, '0', null);
INSERT INTO `review` VALUES ('11', '全程大段大段台词对不上口型；总莫名其妙不合时宜持续不断地响起各种形式风格的配乐；像一个个广告片拼接起来的场面调度；一到枪击动作场面就一定会用高速摄影镜头，导演为了凑满这90分钟也是辛苦了；台词尴尬，5块钱特效，把演员各个导得浮夸都不算事儿，能打负分吗：）', '抢红 (2017)', 'data:image/webp;base64,', '8', '3', '土豆', '0', null, '0', null);
INSERT INTO `review` VALUES ('12', '这堆大咖是集体被下蛊了才接这种片子？？Khan家族？？古堡？？酒神？？剧本是不是郭敬明写的？？？', '抢红 (2017)', 'data:image/webp;base64,', '8', '3', '土豆', '0', null, '0', null);

-- ----------------------------
-- Table structure for `user`
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `login_name` varchar(20) DEFAULT NULL,
  `login_pass` varchar(50) DEFAULT NULL,
  `email` varchar(100) DEFAULT NULL,
  `phone` varchar(11) DEFAULT NULL,
  `nick_name` varchar(20) DEFAULT NULL,
  `ps` varchar(255) DEFAULT NULL,
  `deleted` int(11) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `score` int(11) DEFAULT NULL,
  `site` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

